import USER from "./mockUserData";
import { useState } from "react";

export default function UserDataPage() {
  const [userIndex, setUserIndex] = useState([0]);
  let firstUser = USER[userIndex];
  let name = firstUser.name;
  let username = firstUser.username;
  let email = firstUser.email;
  let imgURL = firstUser.profile_pic_url;
  return (
    <>
      <h1>{username}'s Profile Page</h1>
      <p>
        {name}
        {email}
      </p>
      <img src={imgURL} />
    </>
  );
}
